import React from "react";


const Songlibrary =({set}) =>{
	
	
	
	return(
	
	<div className="library_song">
	
	<h1>Music photo</h1>
	<h1>{set.Music_name}</h1>
	<h1>Artist_name</h1> 
	
	</div>
	
	)
		
		
	
}
export default Songlibrary
